    /**
     * get new flash bg image
     *
     * @param string $uid
     * @return string  base64_encode
     */
    private static function _getNewFlashBgImage($uid)
    {
    	if ($uid == '-1') {
    		return self::_getBaseBgLossless('08');
    	}
    	else if ($uid == '-1') {
    		return self::_getBaseBgLossless('07');
    	}
        else {
            require_once 'Mdal/Ship/Island.php';
            $dalIsland = Mdal_Ship_Island::getDefaultInstance();
            $island = $dalIsland->getIslandByUser($uid);
            return self::_getBaseBgLossless($island['cav_name']);
        }
    }
    
    public static function _getSavedDir($uid)
    {
        $strMd5 = md5($uid);
        $dir0 = substr($strMd5, 0, 1);
        $dir1 = substr($strMd5, 1, 1);
        $dir2 = substr($strMd5, 2, 1);
        $dir3 = substr($strMd5, 3, 1);
        $dir4 = substr($strMd5, 4, 1);
        return '/' . $dir0 . '/' . $dir1 . '/' . $dir2 . '/' . $dir3 . '/' . $dir4 . '/';
    }
    
    /**
